import React from 'react';


class ListProducts extends React.Component {

    componentDidMount() {
        fetch('http://api.dataatwork.org/v1/jobs')
            .then(res => res.json())
            .then((data) => {
                console.log(JSON.stringify(data))
                this.setState({ jobs: data })
            })
            .catch(console.log);
    }
    render() {
        //const items = this.state.response.data.jobs;

        return (
            <div>
                {this.state.result}
                <ol>
                    {this.state.result.map((value, index) => {
                        return <li key={value.uuid}>{value.title}</li>
                    })}
                </ol>
            </div>
        );
    }
}

export default ListProducts;
